INSERT INTO `main_method` VALUES (2,'<h3>Лабораторная работа ЛК4-b</h3>\n\n<p><b>\nМОЩНЫЙАСИНХРОННЫЙ ДВИГАТЕЛЬ В СИСТЕМЕ ЭЛЕКТРОСНАБЖЕНИЯ ПРЕДПРИЯТИЯ.\nИССЛЕДОВАНИЕ УСТОЙЧИВОСТИ РАБОТЫ АСИНХРОННОГО ДВИГАТЕЛЯ ПРИ СНИЖЕНИИ ПИТАЮЩЕГО НАПРЯЖЕНИЯ, \nВЛИЯНИЕ НЕСИММЕТРИИ ПРИЛОЖЕННОГО НАПРЯЖЕНИЯ</b></p>\n\n<p>Цель работы</p>\n\n<p>Экспериментальное исследование устойчивости работы асинхронного двигателя при  понижении напряжения питающей сети. </p>\n\n<p>Программа работы</p>\n<ul>\n<li>Экспериментальное определение напряжения опрокидывания асинхронного двигателя. </li>\n<li>Экспериментальное определение энергетических характеристик асинхронного двигателя при несимметрии напряжений питающей сети.</li>\n<li>Обработка результатов эксперимента.</li>\n<li>Анализ полученных результатов.</li>\n</ul>\n<p>Описание лабораторной установки</p>\n\n<p>Лабораторная работа выполняется на учебных лабораторных стендах №1, №2, №3. Основное оборудование размещено на стенде №1, на стенде №2 используется блок кабельной линии. Стенд №3 – используется только для связи стендов №2 и №3.</p>\n<p>Подача напряжения на стенд №1 производится кнопкой SB1 «ПУСК» (черной), снятие напряжения - кнопкой SB2  «СТОП» (красной), размещенных на блоке УЗО (рис.1.1).</p>\n<p>В лабораторной работе используется следующее оборудование.</p>\n<p>Исследуемый асинхронный двигатель (М1). Объектом исследования является асинхронный двигатель общепромышленного исполнения АДМ63А4У3. Поскольку в лабораторной работе этот двигатель включается на пониженное напряжение, то получаемые данные не совпадают с каталожными. При проведении экспериментов и расчетов характеристик следует руководствоваться паспортными данными машины, приведенными в табл. 1.1. </p>\n<p>Выводы статорной обмотки размещены на клеммной коробке асинхронного двигателя, показанное на рис. 1.2.</p>\n<p>Паспортные данные асинхронного двигателя АДМ63А4У3 (М1)</p>\n<p>Вспомогательная машина (G). Для создания момента сопротивления и добавочного момента на валу асинхронного двигателя используется коллекторная машина постоянного тока ПЛ-072У3 (рис. 1.3). В лабораторной работе эта машина используется в генераторном режиме (для создания тормозного момента). Технические данные машины постоянного тока приведены в табл. 1.2. Источник питания индуктора и нагрузочный реостат МПТ расположены на блоке МП1 (рис. 1.4). Изменение сопротивления осуществляется вращением рукоятки R.</p>\n<p>Паспортные данные машины постоянного тока ПЛ-072У3 (G ) </p>\n<p>Трехфазный трансформатор (ТС1). В качестве силового трансформатора используется трехфазный многообмоточный трансформатор. Трансформатор снабжен коммутационным устройством, позволяющим изменять схемы соединений первичной и вторичной обмоток. Изменение схем соединений первичных обмоток  (Y, Y0, Δ) осуществляется многопозиционным переключателем SA1, изменение схем соединений вторичных обмоток (Y0, Z0, Δ, Y0/0, Y/Δ) и их включение - переключателем SA3. Регулирование напряжения осуществляется переключением отпаек, как первичной обмотки (переключатель SA2) , так  и вторичной обмотки (переключатель SA4). Переключатели SA1, SA3 расположены на лицевой панели лабораторного стенда. Лицевая панель блока трансформатора  Т1  приведены на рис. 1.5.\nВключение и отключение трансформатора ТС1 производится кнопками SB1«ПУСК» и  SB2«СТОП».  \nНоминальные данные трансформатора приведены  в табл. 1.3. </p>',4);
